  false,\n\t\"url\": null,\n\t\"notes\": \"The marine biota of Johnston atoll was
  surveyed for non-indigenous species in June, 2000 with observations and collections
  made by investigators using Scuba. Eleven stations were surveyed, including sites
  at the Johnston Island pier, the north and south lagoon and the outer reef slope.
  A total of 668 taxa were determined, with 462 of these identified to species. Data
  are provided as derived from the report: 2001-001. Coles, S.L., R.C. DeFelice &
  D. Minton. 2001. Marine species survey of Johnston Atoll, central Pacific Ocean,
  June 2000. Report to U.S. Fish & Wildlife Service, Honolulu. Bishop Museum Technical
  Report 19: iv + 56 pp. (Presently found online at http://hbs.bishopmuseum.org/pdf/johnstonreport.pdf)\",\n\t\"owner_org\":
